let get_flag= true;

const random_dum = ()=>get_flag?dum:dum2;

const reducer = (state=initialState,action)=>{
    switch(action.type){
        case ADD_POST:
            get_flag = !get_flag;
            return {
                ...state,
                mainPosts:[random_dum(),...state.mainPosts],
                postAdded:true,
            }
        default :
            return state;
    }
}

export default reducer;